import { useEffect, useState } from "react";
import api from "../services/api";
import Navbar from "../components/Navbar";
import "./Queue.css";

export default function Queue() {
  const [name, setName] = useState("");
  const [serviceType, setServiceType] = useState("GENERAL");
  const [queue, setQueue] = useState([]);

  const fetchQueue = async () => {
    const res = await api.get(`/api/queue/${serviceType}`);
    setQueue(res.data);
  };

  useEffect(() => {
    fetchQueue();
  }, [serviceType]);

  const addCustomer = async () => {
    if (!name) return;
    await api.post("/api/queue/post", {
      customerName: name,
      serviceType,
    });
    setName("");
    fetchQueue();
  };

  const serveCustomer = async (id) => {
    await api.put(`/api/queue/serve/${id}`);
    fetchQueue();
  };

  return (
    <>
      <Navbar />

      <div className="min-h-screen bg-gradient-to-br from-indigo-50 to-purple-100 flex justify-center items-start pt-10">
        <div className="w-full max-w-xl bg-white rounded-2xl shadow-xl p-6">

          <h2 className="text-2xl font-bold text-center text-indigo-700 mb-6">
            ðŸš¦ Queue Management
          </h2>

          {/* Input Row */}
          <div className="flex gap-3 mb-5">
            <input
              type="text"
              placeholder="Customer Name"
              value={name}
              onChange={(e) => setName(e.target.value)}
              className="flex-1 px-4 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-indigo-400"
            />

            <select
              value={serviceType}
              onChange={(e) => setServiceType(e.target.value)}
              className="px-3 py-2 border rounded-lg bg-indigo-50 focus:ring-2 focus:ring-indigo-400"
            >
              <option value="GENERAL">GENERAL</option>
              <option value="BILLING">BILLING</option>
              <option value="CONSULTATION">CONSULTATION</option>
            </select>

            <button
              onClick={addCustomer}
              className="px-5 py-2 bg-gradient-to-r from-indigo-600 to-purple-600 text-white font-semibold rounded-lg hover:scale-105 transition"
            >
              Add
            </button>
          </div>

          <hr className="my-4" />

          {/* Queue Heading */}
          <h3 className="text-lg font-semibold text-indigo-600 mb-3">
            {serviceType} Queue
          </h3>

          {/* Empty */}
          {queue.length === 0 && (
            <p className="text-center text-gray-500 italic">
              No customers in queue
            </p>
          )}

          {/* Queue List */}
          <ul className="space-y-3">
            {queue.map((item, index) => (
              <li
                key={item.id}
                className="flex justify-between items-center bg-gray-50 border-l-4 border-orange-400 p-3 rounded-lg shadow-sm hover:shadow-md transition"
              >
                <div>
                  <p className="font-semibold text-gray-800">
                    {index + 1}. {item.customerName}
                  </p>
                  <span className="text-xs text-gray-500">
                    Service: {item.serviceType}
                  </span>
                </div>

                <button
                  onClick={() => serveCustomer(item.id)}
                  className="px-4 py-1.5 bg-green-600 text-white text-sm rounded-full hover:bg-green-700 hover:scale-105 transition"
                >
                  Serve
                </button>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </>
  );
}
